import styles from './ProductBox.module.scss';

const ProductBox = () => {
  return (
    <div className={styles.root}>
      <div className={styles.container}>
        <div className={styles.photo}>

        </div>
        <div className={styles.data}>

        </div>
      </div>
    </div>
  );
};

export default ProductBox;
